<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <link rel="icon" type="image/svg+xml" href="/vite.svg" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Neon Profile Link Hub</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700&family=Inter:wght@400;500;600;700&display=swap" rel="stylesheet">
    <style>
      /* Custom Font Families */
      .font-orbitron { font-family: 'Orbitron', sans-serif; }
      .font-inter { font-family: 'Inter', sans-serif; } /* Adding a clean, modern sans-serif */

      .background-video {
        position: fixed;
        right: 0;
        bottom: 0;
        min-width: 100%;
        min-height: 100%;
        width: auto;
        height: auto;
        z-index: -10;
        object-fit: cover;
        /* Optional: darken the video to make neon pop */
        filter: brightness(0.5); 
      }

      /* Neon gradient border matching the reference image */
      .border-neon-gradient {
        border-radius: 1rem; /* Adjust to match container border-radius */
        padding: 2px; /* Thickness of the border */
        background: linear-gradient(to right, #6EE7B7, #3B82F6, #9333EA); /* Example gradient */
        background-origin: border-box;
        background-clip: content-box, border-box;
        animation: neon-flow 8s ease infinite; /* Slower animation for subtle glow */
      }

      /* Animated neon flow for the main container border */
      @keyframes neon-flow {
        0% { background-position: 0% 50%; }
        50% { background-position: 100% 50%; }
        100% { background-position: 0% 50%; }
      }

      /* More refined gradient border for links */
      .link-neon-border {
        position: relative;
        border-radius: 0.75rem; /* Matches rounded-lg */
        padding: 1px; /* Thinner border for links */
        background: linear-gradient(to right, #3B82F6, #9333EA, #EC4899); /* Blue-purple-pink */
        background-origin: border-box;
        background-clip: content-box, border-box;
        animation: link-neon-flow 5s linear infinite alternate; /* More subtle link animation */
        transform: translateZ(0); /* Fix for some rendering issues */
      }

      @keyframes link-neon-flow {
        from { background-position: 0% center; }
        to { background-position: -200% center; }
      }

      /* Inner content of the link, slightly smaller to reveal border */
      .link-inner-content {
        background: rgba(10, 10, 20, 0.7); /* Darker background for inner content */
        border-radius: 0.75rem;
        transition: background-color 0.3s ease;
      }

      .link-inner-content:hover {
        background: rgba(20, 20, 40, 0.8); /* Slightly lighter on hover */
      }

      /* Custom styles for the small graphic boxes */
      .graphic-box {
        background: rgba(20, 20, 40, 0.6);
        border-radius: 0.5rem;
        border: 1px solid rgba(100, 100, 200, 0.3); /* Subtle blue border */
        box-shadow: 0 0 5px rgba(100, 100, 200, 0.2);
        transition: transform 0.2s ease, box-shadow 0.2s ease;
      }
      .graphic-box:hover {
        transform: translateY(-3px);
        box-shadow: 0 0 10px rgba(100, 100, 255, 0.5);
      }

      /* For the subtle overlay glow in the corners (top-right and bottom-left) */
      .corner-glow-tr {
        position: absolute;
        top: -20px;
        right: -20px;
        width: 80px;
        height: 80px;
        border-radius: 50%;
        background: radial-gradient(circle, rgba(147, 51, 234, 0.4) 0%, transparent 70%);
        filter: blur(25px);
        z-index: -1;
      }
      .corner-glow-bl {
        position: absolute;
        bottom: -20px;
        left: -20px;
        width: 80px;
        height: 80px;
        border-radius: 50%;
        background: radial-gradient(circle, rgba(59, 130, 246, 0.4) 0%, transparent 70%);
        filter: blur(25px);
        z-index: -1;
      }

    </style>
  </head>
